import React from 'react';
import { Calendar, Row, Col } from 'antd';

const Home = () => {
    return (
        <>
            <Row>
                <Col flex={2}>hihihihi</Col>
                <Col flex={3}>abcdef</Col>
            </Row>
            <Row>
                <Calendar></Calendar>
            </Row>
        </>
    );
};

export default Home;
